import React from 'react';
import UserItem from './UserItem/UserItem';

const userList = props => {

    let users = [];
    for(let i = 0; i < 5; ++i) {
        users.push(<UserItem key = {i} source = "https://i7.pngguru.com/preview/811/233/212/computer-icons-user-login-desktop-wallpaper-others-thumbnail.jpg" name = "SampleName" age = "43" country = "Ukraine" status = "user"/>);      
    }

    return (
        <div>
            {users}
        </div>
    );
};

export default userList;
